import React, { Component } from 'react'
import axios from 'axios';
import url from '../config/default'
import Navbar from "./Navbar.js";

export default class usersessions extends Component {
  constructor(props) {
    super(props);

    this.state = {
      activity: []
    };
    // this.handleChange = this.handleChange.bind(this);
    // this.onSubmit = this.onSubmit.bind(this);
  }

  componentDidMount() {
    axios
      .get(`${url.sessionManagement}/get_user_session/${localStorage.getItem('user')}`)
      .then(response => {
        console.log(response.data);


        this.setState({ activity: response.data });
      })
      .catch(e => {
        console.log(e);
      });
  }


  render() {
    return (
      <div>
        <Navbar></Navbar>
        <h1 style={{ fontSize: "50px", textAlign: "center" }}>Activity</h1>
        <div class="container2">
          <div class="row">

            <div class="col-xs-12">
              <div class="table-responsive">
                <table summary="This table shows how to create responsive tables using Bootstrap's default functionality" class="table table-bordered table-hover">
                  <caption>Users Management of Activity
         </caption>
                  <thead>
                    <tr>

                      <th>Log Date</th>
                      <th>Radar Type</th>
                      <th>Description</th>
                    </tr>
                  </thead>
                  {this.state.activity.map(activity=> (
                    <tbody>
                      <tr>

                        <td>{activity.session.date}</td>
                        <td>{activity.session.radar}</td>
                        <td>{activity.session.description}</td>
                       <td></td>
                      </tr>




                    </tbody>
                  ))}
                </table>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
